import React,{PureComponent,ReactFragment} from 'react';
import {Form,TextField,Checkbox,Link,Button} from '@adobe/react-spectrum';

class LoginForm extends PureComponent{

    render(){
        return(
         <> 
            <h3>Personal</h3>
          <Form maxWidth="size-3600">
            <TextField label="Email" placeholder="abc@adobe.com" />
            <TextField label="Password" placeholder="1234" />
            <Checkbox>Remember me</Checkbox>
            <Link>
            <a href="#" > Forgot Password?</a>
            </Link>
            <Button variant="cta">Login</Button>
            <Link>
            <a href="#" > Sign up</a>
            </Link>
         </Form>
         </>
        );
    }
}
export default LoginForm;
